import React from "react";

import projectList from "../ProjectList";

import DetailTitle from "../components/Work/WorkItem/DetailTitle";
import LargeBox from "../components/Work/WorkItem/LargeBox";
import MediumBox from "../components/Work/WorkItem/MediumBox";
import UpMargin from "../components/Work/WorkItem/UpMargin";
import styles from "./Detail.module.css";
import SmallBox from "../components/Work/WorkItem/SmallBox";

const OLED = () => {
  return (
    <section className="container">
      <LargeBox title="" background="https://i.imgur.com/f71RFmr.png" />
      <DetailTitle
        title={projectList[0].title}
        company={projectList[0].company}
        year={projectList[0].year}
        details={projectList[0].details}
      />
      <UpMargin />
      <div className={styles.box_area}>
        <MediumBox background="https://i.imgur.com/f71RFmr.png" />
        <MediumBox background="https://i.imgur.com/f71RFmr.png" />
        <MediumBox background="https://i.imgur.com/f71RFmr.png" />
        <MediumBox background="https://i.imgur.com/f71RFmr.png" />
      </div>
      <div className={styles.box_area}>
        <SmallBox background="https://i.imgur.com/f71RFmr.png" />
        <SmallBox background="https://i.imgur.com/f71RFmr.png" />
        <SmallBox background="https://i.imgur.com/f71RFmr.png" />
      </div>
    </section>
  );
};

export default OLED;
